# --- FUNCIONES
def fetch_volcanoes(feature_url):
    params = {
        "where": "1=1",
        "outFields": "*",
        "f": "geojson",
        "outSR": "4326",
        "resultRecordCount": 10000
    }
    r = requests.get(feature_url, params=params, timeout=60)
    r.raise_for_status()
    gdf = gpd.read_file(io.StringIO(r.text))
    # Asegurar CRS en lon/lat
    if gdf.crs is None:
        gdf.set_crs(epsg=4326, inplace=True)
    else:
        gdf = gdf.to_crs(epsg=4326)
    return gdf

def get_coastline_from_countries():
    r = requests.get(COUNTRIES_GEOJSON, timeout=60)
    r.raise_for_status()
    countries = gpd.read_file(io.StringIO(r.text))
    union = unary_union(countries.geometry)
    coast_line = union.boundary
    coast_gdf = gpd.GeoDataFrame(geometry=[coast_line], crs="EPSG:4326")
    return coast_gdf

def get_coastline_feature():
    # Usar Natural Earth va cartopy.feature
    return cfeature.NaturalEarthFeature(category='physical',
                                        name='coastline',
                                        scale='10m',
                                        facecolor='none')

def unify_country_coastline():
    # Alternativa: construir lnea de costa a partir de Natural Earth countries
    countries = gpd.read_file(gpd.datasets.get_path("naturalearth_lowres"))
    union = unary_union(countries.geometry)
    coast_line = union.boundary
    coast_gdf = gpd.GeoDataFrame(geometry=[coast_line], crs="EPSG:4326")
    return coast_gdf

def extract_dem_from_zip(zip_path, out_dir, hint=".dem"):
    with zipfile.ZipFile(zip_path, "r") as z:
        names = z.namelist()
        for n in names:
            if hint.lower() in os.path.basename(n).lower():
                out = os.path.join(out_dir, os.path.basename(n))
                with z.open(n) as src, open(out, "wb") as dst:
                    dst.write(src.read())
                return out
        for n in names:
            if n.lower().endswith(".tif"):
                out = os.path.join(out_dir, os.path.basename(n))
                with z.open(n) as src, open(out, "wb") as dst:
                    dst.write(src.read())
                return out
    return None

def list_zip(z):
    with zipfile.ZipFile(z, "r") as zf:
        return zf.namelist()

def extract_first_by_hints(zpath, hints, out_dir):
    with zipfile.ZipFile(zpath, "r") as z:
        names = z.namelist()
        for n in names:
            bn = os.path.basename(n).lower()
            for h in hints:
                if h.lower() in bn:
                    out = os.path.join(out_dir, os.path.basename(n))
                    with z.open(n) as src, open(out, "wb") as dst:
                        dst.write(src.read())
                    return out
        # fallback: primer tif
        for n in names:
            if n.lower().endswith(".tif"):
                out = os.path.join(out_dir, os.path.basename(n))
                with z.open(n) as src, open(out, "wb") as dst:
                    dst.write(src.read())
                return out
    return None

