"""### **Paso 3: Visualizacin de Volcanes en Colombia**"""

# --- CONFIGURACIN: comportamiento para no nombrados ---
# mode: "label" asigna etiqueta genrica numerada; "ignore" omite; "keep_blank" deja vaco
mode = "label"
unnamed_base = "Cerro/Edificio volcnico"  # base para los no nombrados cuando mode == "label"

# --- FUENTES
VOLCANO_FEATURE_URL = "https://services1.arcgis.com/Og2nrTKe5bptW02d/ArcGIS/rest/services/MAPAGEOLOGIA/FeatureServer/0/query"
COUNTRIES_GEOJSON = "https://raw.githubusercontent.com/datasets/geo-countries/master/data/countries.geojson"

# --- BBOX en EPSG:4326 (zona de Colombia que queras mantener)
bbox = (-79.5, -3.3, -69.0, 13.5)  # (minx, miny, maxx, maxy)

# --- EJECUCIN
if __name__ == "__main__":
    # 1) Descargar volcanes y costa
    volcanes = fetch_volcanoes(VOLCANO_FEATURE_URL)
    coast = get_coastline_from_countries()

    # 2) Filtrar volcanes dentro del bbox (zona de Colombia)
    minx, miny, maxx, maxy = bbox
    volcanes = volcanes[
        (volcanes.geometry.x >= minx) & (volcanes.geometry.x <= maxx) &
        (volcanes.geometry.y >= miny) & (volcanes.geometry.y <= maxy)
    ].copy()

    # 3) Determinar campo de nombre
    candidates = ["NombreVolcan"]
    name_field = None
    for c in candidates:
        if c in volcanes.columns:
            name_field = c
            break
    if name_field is None:
        volcanes["__name__"] = ""
        name_field = "__name__"

    # 4) Normalizar nombres: convertir a str, eliminar NaN, strip
    volcanes[name_field] = volcanes[name_field].astype(str).fillna("").str.strip()

    # 5) Aplicar descripcin a los no nombrados
    if mode == "label":
        # asignar etiquetas numeradas solo a los vacos, manteniendo orden original
        mask_empty = volcanes[name_field] == ""
        n_empty = int(mask_empty.sum())
        # crear etiquetas numeradas
        labels = [f"{unnamed_base} {i+1}" for i in range(n_empty)]
        # asignar en el orden en que aparecen
        volcanes.loc[mask_empty, name_field] = labels
    elif mode == "ignore":
        volcanes = volcanes[volcanes[name_field] != ""].copy()
    elif mode == "keep_blank":
        pass


    # 6) Reset index y ordenar por nombre para presentacin (opcional)
    volcanes = volcanes.reset_index(drop=True)
    volcanes = volcanes.sort_values(by=name_field).reset_index(drop=True)

    # 7) Preparar figura con dos paneles: mapa y lista
    fig, (ax_map, ax_list) = plt.subplots(ncols=2, figsize=(13, 9), gridspec_kw={"width_ratios": [3, 1]})

    # Mapa: lnea de costa y volcanes (solo dentro del bbox)
    coast.plot(ax=ax_map, edgecolor="black", linewidth=0.8, facecolor="none")
    volcanes.plot(ax=ax_map, color="red", marker="^", markersize=60, label="Volcanes", zorder=5)

    ax_map.set_xlim(minx, maxx)
    ax_map.set_ylim(miny, maxy)
    ax_map.set_xlabel("Longitud")
    ax_map.set_ylabel("Latitud")
    ax_map.set_title("Volcanes de Colombia")
    ax_map.legend()

    # Lista lateral: nombres numerados y pequeos marcadores
    ax_list.axis("off")
    ax_list.set_title("Estructuras volcnicas (25 activas)", loc="left")

    # Preparar texto: nmero, nombre y coordenadas opcionalmente
    names = volcanes[name_field].astype(str).tolist()
    xs = volcanes.geometry.x.tolist()
    ys = volcanes.geometry.y.tolist()

    N = len(names)
    lines = [f"{i+1}. {names[i]}" for i in range(N)]

    # Ajustar tamao de fuente segn cantidad
    fontsize = 10 if N <= 30 else 8
    y_start = 0.95
    y_step = 0.9 / max(N, 1)
    for i, line in enumerate(lines):
        y = y_start - i * y_step
        ax_list.text(0.02, y, line, transform=ax_list.transAxes, fontsize=fontsize, va="top", ha="left")

    # Aadir nmeros en el mapa para relacionar con la lista
    for i, (x, y) in enumerate(zip(xs, ys)):
        ax_map.plot(x, y, marker="^", color="red", markersize=7, zorder=6)
        ax_map.text(x + 0.03, y + 0.03, str(i+1), fontsize=7, color="black", zorder=7,
                    bbox=dict(facecolor="white", edgecolor="none", alpha=0.7, pad=0.5))

    plt.tight_layout()
    plt.show()

