"""# **Parte 3: Crear un Grfico 3D del Nevado del Ruz**

En esta seccin, generaremos una visualizacin 3D interactiva del Nevado del Ruz a partir de un Modelo Digital de Elevacin (DEM). Para ello, seguiremos los siguientes pasos:

1.  **Extraccin del DEM:** Cargaremos el archivo ZIP que contiene los datos del DEM y extraeremos el archivo DEM principal. (..._RT2.zip es de menor resolucin).
2.  **Recorte de la Regin de Inters:** Definiremos una caja delimitadora (bbox) alrededor del Nevado del Ruz para recortar el DEM y centrarnos en la zona volcnica.
3.  **Remuestreo del DEM:** Para optimizar la memoria y el rendimiento, remuestrearemos el DEM a una resolucin moderada. Esto nos permitir trabajar con el modelo 3D de manera eficiente sin comprometer excesivamente el detalle visual.
4.  **Generacin de Hillshade (sombreado de relieve):** Crearemos un hillshade para visualizar el relieve en 2D y asegurarnos de que el recorte sea correcto.
5.  **Visualizacin 3D Interactiva:** Utilizaremos Plotly para construir un grfico 3D interactivo del Nevado del Ruz, donde la elevacin se representar en el eje Z y la textura (rugosidad) de la superficie mejorar la apreciacin del terreno.
"""

# recorte Nevado del Ruiz - 3d - reduciendo resolucin
# ---------- CONFIGURACIN ----------
zip_path = "/content/AP_27373_FBS_F3520_RT1.zip"   # nombre del ZIP subido a Colab
workdir = "ruiz"
os.makedirs(workdir, exist_ok=True)

# Coordenadas aproximadas del Nevado del Ruiz (lon, lat)
center_lon, center_lat = -75.324, 4.895

# Tamao del recorte alrededor del centro en grados (0.05  5 km)
bbox_pad_deg = 0.03   # reduce para menos memoria

# Factor de reduccin de resolucin para ahorrar RAM (1 = sin reduccin)
downsample_factor = 4  # aumenta para menos pxeles

# Salidas
out_html = os.path.join(workdir, "nevado_ruiz_3d_lowres.html")
preview_png = os.path.join(workdir, "nevado_preview_small.png")

# ---------- FUNCIONES AUXILIARES YA DEFINIDAS ----------

# ---------- 1) Extraer DEM del ZIP ----------
dem_path = extract_dem_from_zip(zip_path, workdir, hint=".dem")
if dem_path is None:
    raise SystemExit("No se encontr DEM en el ZIP. Asegrate de subir el ZIP correcto.")
print("DEM extrado:", dem_path)

# ---------- 2) Calcular bbox pequeo alrededor del volcn ----------
minx = center_lon - bbox_pad_deg
