maxy = center_lat + bbox_pad_deg
print("BBox (deg):", (minx, miny, maxx, maxy))

# ---------- 3) Abrir DEM y leer solo la ventana (recorte) con remuestreo ----------
with rasterio.open(dem_path) as src:
    dem_crs = src.crs
    if dem_crs is None:
        raise SystemExit("El DEM no tiene CRS definido.")
    # transformar bbox a CRS del DEM si es necesario
    # Es necesario porque el DEM est en WGS 84 / UTM zone 18N (EPSG:32618)
    if dem_crs.to_string() != "EPSG:4326":
        from pyproj import Transformer
        transformer = Transformer.from_crs("EPSG:4326", dem_crs, always_xy=True)
        bx0, by0 = transformer.transform(minx, miny)
        bx1, by1 = transformer.transform(maxx, maxy)
        bbox_dem = (min(bx0,bx1), min(by0,by1), max(bx0,bx1), max(by0,by1))
    else:
        bbox_dem = (minx, miny, maxx, maxy)

    window = from_bounds(*bbox_dem, transform=src.transform)
    window = window.round_offsets().round_lengths()
    win_width = int(window.width)
    win_height = int(window.height)
    print("Ventana pxeles (w,h):", win_width, win_height)

    # calcular out_shape reducido para ahorrar memoria
    out_width = max(8, win_width // downsample_factor)
    out_height = max(8, win_height // downsample_factor)
    print("Lectura remuestreada a (w,h):", out_width, out_height)

    dem_clip = src.read(1, window=window, out_shape=(out_height, out_width), resampling=Resampling.bilinear).astype(float)
    dem_transform = src.window_transform(window)
      # dem_transform contendr la informacin necesaria para saber exactamente dnde se ubica geogrficamente cada pxel del
      #segmento del DEM que has recortado

    # ajustar transform para el out_shape
    scale_x = win_width / out_width
    scale_y = win_height / out_height
    dem_transform = rasterio.Affine(dem_transform.a * scale_x, dem_transform.b, dem_transform.c,
                                   dem_transform.d, dem_transform.e * scale_y, dem_transform.f)
    nodata = src.nodata
    if nodata is not None:
        dem_clip[dem_clip == nodata] = np.nan

print("DEM recortado shape:", dem_clip.shape)

